"use strict";
{ // Basic Data Type
    // string
    let ownerName = 'Mr X';
    //number
    let salary = 2000;
    //boolean
    let isItExpert = true;
    //undefined
    let a = undefined;
    //null
    let b = null;
    //anyType
    let x;
    x = "Mr H";
    x = 1214;
    x = true;
    //array
    let student = ['X', 'Y'];
    let selectedStudentId = [1, 3];
    //tuple ==> array --> order --> type of value
    let coordinates = [1, 3];
    let nameAge = ['Batman', 30, true];
    nameAge[0] = 'Iron Man';
    nameAge[1] = 42;
}
